  faSignal,
  faQuestion,
  faPalette,
} from "@fortawesome/free-solid-svg-icons";

const themeicon = (fill) => {
  return <div></div>
}

export const Tabs = {
  home: { body: Home, displayName: "Home", Icon: faHome },
  dashboard: {
    body: Dashboard,
    displayName: "Dashboard",
    Icon: faSignal,
  },
  theme: {
    body: ManageThemes,
    displayName: "Manage Themes",
    Icon: faPalette
  },  
  help: {
    body: Help,
    displayName: "Help Center",
    Icon: faQuestion
  }
};
